import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Divider from '@mui/material/Divider';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import { FacebookAuth, GoogleAuth, AppleAuth } from '../oAuth/oAuthButtons'
import susitaLogo from './susita_logo.png';

function Copyright(props) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        susita.com
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}


const theme = createTheme({
  status: {
    danger: '#e53e3e',
  },
  palette: {
    primary: {
      main: '#636e51', //SUSITA MAIN COLOR CODE
      darker: '#Eef3eb',
    },
    neutral: {
      main: '#64748B',
      contrastText: '#fff',
    },
  },
});

export default function Join() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Paper
          elevation={2}
          sx={{
            mt: 8,
            p: 4,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            borderRadius: '30px',
            bgcolor: 'rgba(250, 250, 250, 0.2)',
            border: '1px solid grey',
            backdropFilter: 'blur(10px)',
          }}
        >
          <img src={susitaLogo} width={'40px'} height='auto' />
          <Typography
            variant="h3"
            style={{ fontFamily: 'Kalam' }}
            noWrap
            sx={{
              mt: '15px',
              display: { xs: 'none', md: 'flex' }, fontWeight: 300,
              color: '#Cb6605',
              textDecoration: 'none'
            }}
          >
            Join Susita
          </Typography>
          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
              sx={{
                '& .MuiInputBase-root': {
                  backgroundColor: 'transparent',
                },
              }}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            <Grid container>
              <Typography
                sx={{
                  fontSize: 11,
                  fontFamily: 'Open Sans',
                  fontWeight: 300,
                  display: { xs: 'none', md: 'flex' },
                  color: '#949494',
                }}
              >
                <span >By clicking Agree &amp; Join, you agree to the Susita <a href="https://www.susita.co.il/legal/user-agreement?trk=registration-frontend_join-form-user-agreement" data-tracking-will-navigate="" data-tracking-control-name="registration-frontend_join-form-user-agreement">User Agreement</a>, <a href="https://www.susita.com/legal/privacy-policy?trk=registration-frontend_join-form-privacy-policy" data-tracking-will-navigate="" data-tracking-control-name="registration-frontend_join-form-privacy-policy">Privacy Policy</a>, and  <a target="_blank" href="https://www.linkedin.com/legal/cookie-policy?trk=registration-frontend_join-form-cookie-policy" data-tracking-will-navigate="" data-tracking-control-name="registration-frontend_join-form-cookie-policy">Cookie Policy</a>. </span>
              </Typography>
            </Grid>
            <Button
              style={{ borderRadius: '30px' }}
              fullWidth
              color='primary'
              variant="contained"
              sx={{
                mt: 1, mb: 3, height: '45px',
                '&:hover': {
                  '& > *': { color: '#Eef3eb' },
                }
              }}
            >
              <Typography
                sx={{
                  fontSize: 17, fontFamily: 'Open Sans', fontWeight: 500,
                  letterSpacing: '.0.5rem', textTransform: 'none'
                }}>
                Agree & Join
              </Typography>
            </Button>
            <Divider sx={{ borderWidth: 10, mb: '15px' }}>
              <Typography
                variant="h6"
                sx={{
                  fontSize: 15.5, fontFamily: 'Open Sans', fontWeight: 300,
                  letterSpacing: '.0.5rem', textTransform: 'none',
                  display: { xs: 'none', md: 'flex' },
                  color: '#949494',
                  textDecoration: 'none'
                }}
              >
                or sign in with
              </Typography>
            </Divider>
            <Box sx={{
              display: 'flex',
              flexDirection: 'row',
              alignItems: 'center',
              justifyContent: 'center'
            }}>
              {/* <FacebookAuth /> */}
              <GoogleAuth width={320} idSuffix="2" />
            </Box>
          </Box>
        </Paper>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>
  );
}
